CREATE TABLE IF NOT EXISTS osm_places(
   type         VARCHAR(30) NOT NULL PRIMARY KEY
  ,name         VARCHAR(76) NOT NULL
  ,nameEn       VARCHAR(59)
  ,country      VARCHAR(15)
  ,country_code VARCHAR(2)
  ,state        VARCHAR(19)
  ,county       VARCHAR(14)
  ,city         VARCHAR(25)
  ,municipality VARCHAR(38)
  ,postcode     VARCHAR(4)
  ,suburb       VARCHAR(29)
  ,street       VARCHAR(48)
  ,lon          VARCHAR(18) NOT NULL
  ,lat          VARCHAR(18) NOT NULL
  ,formatted    VARCHAR(133)
  ,addressLine1 VARCHAR(76)
  ,addressLine2 VARCHAR(83)
  ,osmId        VARCHAR(33) NOT NULL
  ,wikiData     VARCHAR(39)
  ,FIELD20      VARCHAR(48)
  ,FIELD21      VARCHAR(18)
  ,FIELD22      VARCHAR(17)
  ,FIELD23      VARCHAR(9)
  ,FIELD24      VARCHAR(30)
);
